import React, { useState } from "react";
import "./App.css";

function App() {
  const [submitted, setSubmitted] = useState(false);
  const [form, setForm] = useState({
    nome: "",
    cpf: "",
    email: "",
    telefone: "",
    descricao: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const listaExistente = JSON.parse(localStorage.getItem("denuncias")) || [];
    listaExistente.push({ ...form, data: new Date().toISOString() });
    localStorage.setItem("denuncias", JSON.stringify(listaExistente));

    setSubmitted(true);
  };

  const handleBack = () => setSubmitted(false);

  // Fun√ß√£o para validar checklist
  const validarChecklist = () => {
    return [
      {
        pergunta: "O site possui certificado HTTPS v√°lido?",
        atende: true // simula√ß√£o: sempre atende neste projeto
      },
      {
        pergunta: "O dom√≠nio √© realmente da institui√ß√£o (ex: gov.br, edu.br)?",
        atende: true // simula√ß√£o: pode depender do dom√≠nio real
      },
      {
        pergunta: "H√° canais oficiais de contato confirmando o formul√°rio?",
        atende: !!form.email || !!form.telefone
      },
      {
        pergunta: "H√° assinatura ou selo de verifica√ß√£o institucional?",
        atende: !!form.nome
      },
      {
        pergunta: "O conte√∫do informa pol√≠tica de privacidade e uso de dados?",
        atende: !!form.descricao
      }
    ];
  };

  return (
    <div className="container">
      {!submitted ? (
        <>
          <header className="header">
            <div className="logo">üèõÔ∏è <span>√ìrg√£o Institucional</span></div>
          </header>

          <h1>Portal de Den√∫ncias Institucionais</h1>
          <p>Preencha o formul√°rio abaixo para enviar sua den√∫ncia an√¥nima.</p>

          <form onSubmit={handleSubmit} className="formulario" autoComplete="off">
            <label>Nome completo:</label>
            <input name="nome" type="text" value={form.nome} onChange={handleChange} required />

            <label>CPF:</label>
            <input name="cpf" type="text" value={form.cpf} onChange={handleChange} required />

            <label>E-mail:</label>
            <input name="email" type="email" value={form.email} onChange={handleChange} required />

            <label>Telefone:</label>
            <input
              name="telefone"
              type="tel"
              value={form.telefone}
              onChange={handleChange}
              required
              placeholder="(99) 99999-9999"
            />

            <label>Descri√ß√£o da den√∫ncia:</label>
            <textarea name="descricao" value={form.descricao} onChange={handleChange} required></textarea>

            <button type="submit">Enviar den√∫ncia</button>
          </form>
        </>
      ) : (
        <div className="checklist">
          <h2>Checklist de Verifica√ß√£o Institucional ‚úÖ</h2>
          <ul>
            {validarChecklist().map((item, index) => (
              <li key={index} style={{ color: item.atende ? "green" : "red" }}>
                {item.pergunta} ‚Äî {item.atende ? "‚úÖ Atendido" : "‚ùå N√£o atendido"}
              </li>
            ))}
          </ul>
          <button
            onClick={handleBack}
            style={{
              marginTop: "15px",
              padding: "8px 15px",
              borderRadius: "6px",
              cursor: "pointer",
            }}
          >
            Voltar ao formul√°rio
          </button>
        </div>
      )}

      <footer className="footer">
        <small>Projeto educativo ‚Äî n√£o envie dados reais.</small>
      </footer>
    </div>
  );
}

export default App;
